import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import {BrowserRouter, Route} from 'react-router-dom';
import MoviePosterInfo from './components/MoviePosterInfo/MoviePosterInfo';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Route exact={true} path='/' component={Layout}/>
      <Route exact={true} path='/info' component={MoviePosterInfo }/>
    </BrowserRouter>
    </div>
  );
}

export default App;
